import '../Styles/home.css';
import clouds from '../Media/clouds2.jpg';

const Home = () =>
{
    return(
        <div className='homeMainContainer'>
            <div className='imageObject'>
                <img className='image' src={clouds}><button className='getStartedButton'>Get Started</button></img>
                
            </div>
            Home Page
        </div>
    )
}

export default Home;
